import React, { useState, useEffect } from 'react';
import StartMenu from "./templates/StartMenu";

const Game = () => {

    const [start, setStart] = useState(false);

    return (
        <>

            { start ? 
                <h1>END</h1> :
                <StartMenu setStart={setStart} /> 
            }

        </>
    );

};

export default Game;
